import React from "react";

import GonBack from "../../component/goback/gonback";
import Table from "../../component/table/table";
import NewTable from "../../component/table/newTable";

export default class Index extends React.Component{
    constructor(props) {
        super(props);
        this.state={}
    }
    render(){
        const _Content = {
            width:'100%',
            height:'auto',
            border:'1px solid #666666',
            background:'skyblue'
        }
        const _Header = {
            width: "90%",
            height: "500px",
            border: "1px solid #666666",
            margin:"0 auto",
            // overflow:'scroll'
        }
        const _Bottom = {
            width: "90%",
            height: "500px",
            border: "1px solid #666666",
            margin:"0 auto",
            overflow:'scroll'
        }
        return (
            <div style={_Content}>
                <GonBack />
                <div style={_Header} className='Header'>
                    <Table />
                </div>
                <div style={_Bottom} className='Bottom'>
                    <NewTable />
                </div>
            </div>
        )
    }
}
